        buf.readUnsignedByte();// header

        int type = buf.readUnsignedByte();
        buf.readUnsignedByte();// length

        if ((type == org.traccar.protocol.PiligrimProtocolDecoder.MSG_GPS) || (type == org.traccar.protocol.PiligrimProtocolDecoder.MSG_GPS_SENSORS)) {
            org.traccar.model.Position position = new org.traccar.model.Position();
            position.setProtocol(getProtocolName());
            position.setDeviceId(deviceSession.getDeviceId());
            org.traccar.helper.DateBuilder dateBuilder = new org.traccar.helper.DateBuilder().setDay(buf.readUnsignedByte()).setMonth(buf.getByte(buf.readerIndex()) & 0xf).setYear(2010 + (buf.readUnsignedByte() >> 4)).setTime(buf.readUnsignedByte(), buf.readUnsignedByte(), buf.readUnsignedByte());
            position.setTime(dateBuilder.getDate());
            double latitude = buf.readUnsignedByte();
            latitude += buf.readUnsignedByte() / 60.0;
            latitude += buf.readUnsignedByte() / 6000.0;
            latitude += buf.readUnsignedByte() / 600000.0;
            double longitude = buf.readUnsignedByte();
            longitude += buf.readUnsignedByte() / 60.0;
            longitude += buf.readUnsignedByte() / 6000.0;
            longitude += buf.readUnsignedByte() / 600000.0;
            int flags = buf.readUnsignedByte();
            if (org.traccar.helper.BitUtil.check(flags, 0)) {
                latitude = -latitude;
            }
            if (org.traccar.helper.BitUtil.check(flags, 1)) {
                longitude = -longitude;
            }
            position.setLatitude(latitude);
            position.setLongitude(longitude);
            int satellites = buf.readUnsignedByte();
            position.set(org.traccar.model.Position.KEY_SATELLITES, satellites);
            position.setValid(satellites >= 3);
            position.setSpeed(buf.readUnsignedByte());
            double course = buf.readUnsignedByte() << 1;
            course += (flags >> 2) & 1;
            course += buf.readUnsignedByte() / 100.0;
            position.setCourse(course);
            if (type == org.traccar.protocol.PiligrimProtocolDecoder.MSG_GPS_SENSORS) {
                double power = buf.readUnsignedByte();
                power += buf.readUnsignedByte() << 8;
                position.set(org.traccar.model.Position.KEY_POWER, power * 0.01);
                double battery = buf.readUnsignedByte();
                battery += buf.readUnsignedByte() << 8;
                position.set(org.traccar.model.Position.KEY_BATTERY, battery * 0.01);
                buf.skipBytes(6);
            }
            positions.add(position);
        } else if (type == org.traccar.protocol.PiligrimProtocolDecoder.MSG_EVENTS) {
            buf.skipBytes(13);
        }
    } 
